import styles from "../styles/Footer.module.css";
import TP from "pfp.png";

const Footer = () => {
  return (
    <div className={styles.all}>
      <p>Let's Connect</p>
      <img
        style={{
          width: "20%",
          height: "20%",
          marginLeft: "5%",
          display: "inline",
        }}
        src={TP.src}
      />
    </div>
  );
};

export { Footer };
